import '../Style/Navbar.css';
import logo from '../Assets/WiCyS Logo.png';

const NavBar = () => {
  return <div className="Bar">
    <img className="NavbarLogo" src={logo} alt="logo" />
    <div className="AllLinks">
      {/* TODO: fix href */}
      <a href="/dashboard" className="NavbarItem">About</a>
      <a href="/enterinfo" className="NavbarItem">Events</a>
      <a href="/" className="NavbarItem">Board</a>
      <a href="/" className="NavbarItem">Newsletter</a>
    </div>
  </div>;
}

export default NavBar;
